import './App.css';
import Header from './components/Header/Header';
import Crickter from './components/Crickter/Crickter';

import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

function App() {
    return ( 
        <Router>
            <Switch>
                <Route path="/home">
                    <Header />
                </Route>
                <Route path="/">
                    <Header />
                </Route>
                <Route path="*">
                    <Header />
                </Route>
            </Switch>
        </Router>
    );
}

export default App;
